import React, { useEffect, useState } from "react";
import Papa from "papaparse";

export default function EstablishmentsPage() {
  const [lodgings, setLodgings] = useState([]);
  const [restaurants, setRestaurants] = useState([]);

  useEffect(() => {
    Papa.parse("/establishments.csv", {
      download: true,
      header: true,
      complete: (res) => {
        const rows = res.data.filter((r) => r.type && r.name);
        setLodgings(rows.filter((r) => r.type === "Lodging"));
        setRestaurants(rows.filter((r) => r.type === "Restaurant"));
      },
    });
  }, []);

  return (
    <div className="p-6">
      <h1 className="text-2xl font-bold mb-4">Establishments</h1>

      <section className="mb-6">
        <h2 className="text-xl font-semibold mb-2">Lodgings</h2>
        <ul className="list-disc pl-6">
          {lodgings.map((l, i) => (
            <li key={i}>
              <strong>{l.name}</strong> – {l.description}
            </li>
          ))}
        </ul>
      </section>

      <section>
        <h2 className="text-xl font-semibold mb-2">Restaurants</h2>
        <ul className="list-disc pl-6">
          {restaurants.map((r, i) => (
            <li key={i}>
              <strong>{r.name}</strong> – {r.description}
            </li>
          ))}
        </ul>
      </section>
    </div>
  );
}
